import CakeList from "./CakeLIst";
import Carousel from "./Carousel";
function Home({url}) {
    return (
        <div>
            <div className="row" style={{width:"100%", height:"75vh"}}>
                <Carousel/>
            </div>
            <div className="container">
                <div className="row">
                    <CakeList url={url}/>
                </div>
            </div>
        </div>
    );
}

export default Home;
